INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (24001, 35, 0, 1, 15, 30000, "", 0, 2, "", 0);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 36, 0, 100, 1, 40000, "", 0, 8, "", 0);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 37, 107501, 150, 1, 40001, "ぺコリーヌ", 0, 8, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 38, 107601, 150, 2, 40001, "コッコロ", 0, 8, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 39, 107801, 150, 3, 40001, "キャル", 0, 8, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 40, 107701, 150, 4, 40001, "スズメ", 0, 8, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 41, 107901, 150, 5, 40001, "タマキ", 0, 8, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 42, 107501, 150, 6, 40001, "ぺコリーヌ", 0, 8, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 43, 107601, 150, 7, 40001, "コッコロ", 0, 8, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 44, 107801, 150, 8, 40001, "キャル", 0, 8, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 45, 107701, 150, 9, 40001, "スズメ", 0, 8, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (91002, 46, 107901, 150, 10, 40001, "タマキ", 0, 8, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 2);
